import React, { useState } from "react";
import Item from "./Item";

function Todo() {
  const [state, setState] = useState(0);

  const increment = () => {
    setState((preveState) => preveState + 1);
  };
  return (
    <div>
      <Item item={state} />
      <button onClick={increment}>Increment</button>
      <button>Decrement</button>
    </div>
  );
}

export default Todo;
